When function calls are nested inside each other, they can be difficult to read and understand at a glance: [e: [d: [c: [b: [a: 1]; 2]; 3]; 4]; 5] # Welcome to bracket hell An alternative way to write nested function calls is by using iterative (rather than recursive) syntax-- a method known as piping . By using piping, the same expression above can be rewritten with only a single pair of brackets: [a: 1 |> b: 2 |> c: 3 |> d: 4 |> e: 5] # Much more readable! In a piped function call, the output of one function is fed into the input of the next. By default, the output is inserted as the first argument; however, this can be changed by passing the pipe value [] as an argument: [$get-zipper] { {<add>|<sub>}
} # Pass the output of [get-zipper] as the third argument for [zip]
[get-zipper |> zip: (1; 2; 3); (4; 5; 6); []] If the pipe value is a function, you can call it directly using an anonymous call: [$get-math-func] { {<add>|<mul>|<sub>|<div>}
} # Get a random math function and call it, passing in two numbers
[get-math-func |> ![]: 3.0; 2.0]

