A basic depth getter can still capture its target variable into a function, which can produce confusing results: <%MARKER>
[%measure] { <MARKER&>
} # This should print 1... right?
[measure] This prints: 0 (Wait, what?) This happens because MARKER is captured into [measure] as a local variable, and is thus redeclared in the main [measure] scope. Since the depth getter is also at this scope level, we get a result of 0 instead of 1. Thankfully, this is easy to fix: just descope the getter and it will no longer capture: <%MARKER>
[%measure] { <^MARKER&> # Now with descope
} [measure] # Should print 1 Barring unexpected cosmic rays, this should now work as expected and print 1.
